import React, {useState} from "react";
import {useHistory, withRouter} from "react-router-dom";
import {Tabs, Tab} from "@material-ui/core";

const MainTab = (tabValue) => {
    console.log(Number(tabValue))
    const [value, setValue] = useState(Number(tabValue))
    const history = useHistory();
    const HandleChange = (event, newValue) => {
        setValue(newValue)
        history.replace(newValue === 0 ? "/main/art" : newValue === 1 ? "/main/my" : newValue === 2 ? "/main/create" : newValue === 3 ? "/main/support" : "/main/art");
    };

    return (
        <div>
            <Tabs value={value} onChange={HandleChange}>
                <Tab label="Art"/>
                <Tab label="My"/>
                <Tab label="Create"/>
                <Tab label="Support"/>
            </Tabs>
        </div>
    );
}

export default withRouter(MainTab);
